try.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// External contract interface
interface IRecipient {
    function receiveFunds(uint amount) external;
}

contract FundDistributor {
    event TransferSuccessful(address indexed recipient, uint amount);
    event TransferFailed(address indexed recipient, uint amount);

    function distributeFunds(address[] memory recipients, uint amount) public {
        for (uint i = 0; i < recipients.length; i++) {
            // Creating an instance of the external contract
            IRecipient recipientContract = IRecipient(recipients[i]);

            try recipientContract.receiveFunds(amount) {
                // If successful, emit an event
                emit TransferSuccessful(recipients[i], amount);
            } catch {
                // If it fails, emit a failure event
                emit TransferFailed(recipients[i], amount);
            }
        }
    }
}

